import React from 'react';
import Stack from '@mui/material/Stack';
import './Cameras.css'


function CameraMaster(){
    return(
        <div>
            <Stack spacing={2} direction="row" justifyContent="center" alignItems="center">
            <p style={{textAlign: 'center'}}>Enter Camera URL here: <input type="text" id="IP"></input> or</p> {/*IP id is for connecting cameras over the cloud using the cameras IP Address. */}
            <JumpIPs/>
            <ControlCenter/>
            </Stack>
        </div>
    )
}
function ControlCenter(){
    return(
        <div style={{textAlign: 'center', padding: '100px'}}>
            <Stack direction="row" spacing={2} justifyContent="center" alignItems="center">
            <p className="cameraScreen">Front Entrance</p>
            <p className="cameraScreen">Centre View</p>
            <p className="cameraScreen">Centre View 2</p>
            <p className="cameraScreen">Back Exit</p>
            </Stack>
        </div>
    )
}
function JumpIPs(){
    return(
        <div style={{textAlign: 'center'}}>
            <p style={{textAlign: 'center'}}><i style={{color: 'blue'}}>Jump</i> to</p>
            <div class="dropdown">
                <button class="dropbtn">Menu</button>
                <div class="dropdown-content">
                <a href="https://www.example.com">Front Entrance</a>
                <a href="https://www.example.com">Centre View</a>
                <a href="https://www.example.com">Centre View 2</a>
                <a href="https://www.example.com">Back Exit</a>
        </div></div></div>
    )
}
export default CameraMaster;
